        super(props);
        this.state={
            n_apt: ""
        }
    }
    render() {
        return (
            <div>
                <h1></h1>
                <Form className="retalForm">
                    <FormGroup>
                        <Label>Apartment number</Label>
                        <Input placeholder = "#ApportmentNumber" ></Input>
                    </FormGroup>
                </Form>
            </div>
        )
    }
}

